sentences:
  - 'Flaxseed, also known as linseed, consists of the seeds of the flax plant (Linum usitatissimum).'
  - 'Flaxseed is a good dietary source of vitamin E, phosphorus, manganese, magnesium, folate, copper and zinc.'
  - 'Flaxseed is the richest known source of plant lignans, mainly secoisolariciresinol, which are converted by intestinal microbiota to the mammalian lignans enterodiol and enterolactone.'
  - 'Flaxseed also contains high levels of the omega-3 fatty acid alpha-linolenic acid and is a good source of melatonin, both of which have been shown to confer protection against breast cancer.'
  - 'Flaxseed has been shown to have radioprotective, antioxidant and cholesterol-reducing properties.'
  - Flaxseed has been reported to inhibit lung and colorectal cancer in mice.
  - 'Consumption of flaxseed has been found to be associated with biological changes that may be protective for prostate cancer, but the relationship between flaxseed consumption and prostate cancer is unclear.'
  - Flaxseed and its component have been shown to reduce breast cancer cell growth and enhance breast cancer cell apoptosis.
  - These studies have demonstrated that flaxseed can reduce the growth and proliferation of both ER- and ER+ breast cancers.
  - A meta-analysis combining the results of seven studies found that plant lignan consumption was associated with reduced risk of breast cancer in postmenopausal women.
  - 'A major Swedish prospective study found a reduction in risk of breast cancer in postmenopausal women for those in the highest quartile of plant lignan intake, especially among hormone replacement therapy users.'
  - The reduction in risk did not vary by ER or PR status of the tumors.
  - 'Another study reported that high circulating levels of enterolactone reduce the risk of breast cancer recurrence and death among postmenopausal women, especially those with estrogen receptor negative (ER-) breast cancer.'
  - 'As noted above, flaxseed is a good source of melatonin.'
  - 'Melatonin protects against breast cancer in several ways, including by reducing aromatase activity within the breast, thereby reducing estrogen production.'
  - Flaxseed has been shown to protect the lungs during radiation for lung cancer without reducing the efficacy of the treatment.
  - Flaxseed has also been shown to enhance the effectiveness of both tamoxifen and Herceptin.
  - Flaxseed has been shown to counteract the breast cancer promoting effects of the soy isoflavone genistein on ER+ breast cancer in mice.
  - One study comparing flax seeds with sesame seeds (also high in lignans) came to the conclusion that the breast cancer protective qualities of flaxseed were due to its high Î±-linolenic acid content as much as its lignan content.
  - Another study concluded that the lignan component of flaxseed appears to be most beneficial throughout the promotional phase of carcinogenesis whereas the oil component is more effective at the stage when tumors have already been established.
  - Both flaxseed and flaxseed oil have been shown to be associated with reduced risk of breast cancer.
  - 'Since flaxseed contains both the lignans and the oil, it appears preferable, on balance, to flaxseed oil.'
  - 'Because of the high nutrient content of flaxseed, it is subject to spoilage and must be stored and handled properly.'
  - Make sure the market where you purchase flaxseed (whether prepackaged or from bulk bin) has frequent product turnover.
  - Check for moisture before buying flaxseed and discard any flaxseed stored at home if there is any evidence of moisture or a rancid smell.
  - 'Whole flaxseed can safely be stored in an airtight container in a dry, dark, and cool place for several months.'
  - Ground flaxseed is also available; the nutrients in ground seeds are more easily absorbed.
  - Ground flaxseed is more subject to oxidation and spoilage than whole flaxseed and should be refrigerated.
  - Flaxseed oil is commonly produced by cold pressing whole flaxseed.
  - It should be stored in opaque bottles and always kept refrigerated.
  - 'Flaxseed oil is used in stir-frying in parts of Asia, but we advise against this.'
  - 'Flaxseed oil should be added to foods after they have been heated, if desired, or used in salad dressings or cold sauces prepared without heating.'
  - 'One study that examined the effects of using flaxseed oil in stir-frying found that pan-heating caused a significant loss of important nutrients, as well as increases in undesirable oxidation products.'
  - 'Linseed oil is also made from flaxseed, but the term refers to a highly processed oil that is used in industrial applications and it is not suitable for human consumption.'
  - The flax plant is also used to make linen and related fabrics.
  - 'Flaxseed can absorb unacceptable levels of cadmium, a heavy metal that has been shown to increase the risk of breast cancer.'
  - This is not as unlikely a problem as it may first appear.
  - "Areas of Canada, which is the world's largest producer of flaxseed, have high levels of cadmium in the soil."
  - 'North and South Dakota, the two largest producing U.S. states, also are known to have cadmium in the soil.'
  - 'The other major producers are China and India, both known for heavy metal pollution in some regions.'
  - Farmers do not have to be concerned about heavy metal soil contamination when growing flax for linseed oil or linen production.
  - The market for linseed oil and linen flax have been declining whereas the market for flaxseed meant for human consumption has been increasing and is more lucrative.
  - 'Therefore, it is possible that flaxseed from high-cadmium areas are reaching the U.S. consumer.'
  - 'The "organic" label does not necessarily mean a low-cadmium product.'
  - Mouse studies have demonstrated that significant levels of cadmium can be absorbed from dietary flaxseed.
  - 'In addition, the female pups of pregnant or lactating rats fed flaxseed have increased susceptibility to developing mammary tumors.'
  - 'In addition, flaxseed contains relatively high levels of copper, which has been shown to increase angiogenesis and metastasis of breast cancer.'
  - The cadmium and copper content of flaxseed are the reason we recommend consuming flaxseed in moderation.
  - _Below are links to recent studies concerning this food.
  - 'For a more complete list, including less recent studies, please click on flaxseed._'
